INSERT INTO `news` (`id`, `title`, `slugname`, `description`, `content`, `meta_title`, `meta_description`, `meta_keyword`, `tags_id`, `create_time`, `public_time`, `update_time`, `create_by`, `update_by`, `thumbnail`, `category_id`, `status`, `hit_view`, `is_hot`, `is_popular`, `relate_news`, `source`, `source_url`, `display_author`, `display_ads_box`, `highlight_image`, `highlight_alt`, `source_id`) VALUES
(1, 'Đề xuất ngừng dự án trung tâm hoá chất thay chợ Kim Biên', '', 'Sở Công Thương đề xuất TP HCM ngừng thực hiện dự án trung tâm hoá chất thay thế chợ Kim Biên do gặp nhiều vướng mắc và đánh giá đề án không còn phù hợp.\r\n\r\nDự án Trung tâm Kinh doanh hương liệu, hoá chất (thay thế chợ Kim Biên) rộng hơn 11,2 ha có tổng mức đầu tư hơn 1.350 tỷ đồng, được TP HCM thông qua chủ trương từ 2016. Trung tâm này được xây dựng tại Khu chức năng số 15 trong Khu đô thị mới Nam TP HCM thuộc phường 7, quận 8.', '', NULL, NULL, NULL, NULL, '2022-04-18 16:12:14', '2022-04-18 16:12:14', '2022-04-18 16:12:14', 0, NULL, NULL, 1, 1, 1, 1, 0, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL),
(2, 'Cháy cửa hàng, một người chết', '', 'TP HCMPhá cửa căn phòng tại tầng 4 của cửa hàng quần áo cạnh chợ Hạnh Thông Tây, quận Gò Vấp, cảnh sát phát hiện người đàn ông đã tử vong, trưa 18/4.', '', NULL, NULL, NULL, NULL, '2022-04-18 16:12:14', '2022-04-18 16:12:14', '2022-04-18 16:12:14', 0, NULL, NULL, 2, 1, 0, 0, 0, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL),
(3, 'tin tức vịt', '', '', '', NULL, NULL, NULL, NULL, '2022-04-19 06:44:48', '2022-04-19 06:44:48', '2022-04-19 06:44:48', 0, NULL, NULL, 1, 1, 0, 0, 0, NULL, NULL, NULL, 1, 1, NULL, NULL, NULL),
