INSERT INTO `relation` (`id`, `name`, `position`, `image`, `image_trans`, `url`, `description`, `status`, `content`, `email`, `facebook`, `instagram`, `phone`, `address`, `is_hot`, `group_index`, `deposit_amount`, `invest_location`, `deposit_text`) VALUES
(1, 'Vinhomes', 1, NULL, NULL, 'https://vinhomes.vn/vi', 'Vinhomes là thương hiệu bất động sản số 1 Việt Nam, hoạt động trong lĩnh vực phát triển, chuyển nhượng và vận hành bất động sản', 1, 'Vinhomes Star City tọa lạc tại trung tâm phát triển mới giữa lòng thành phố Thanh Hóa:\r\n\r\n• 1 mặt tiếp giáp Đại lộ Lê Lợi, thuộc tuyến quốc lộ 1A – trục kinh tế Bắc – Trung – Nam kết nối thành phố Thanh Hóa trực tiếp đến các thành phố lớn như Hà Nội, Hải Phòng,…\r\n\r\n• 1 mặt tiếp giáp đại lộ Hùng Vương thuộc đường tránh Quốc lộ 1A, kết nối thành phố Thanh Hóa đến các phường, xã lân cận.\r\n\r\n• 1 mặt tiếp giáp đại lộ Nam Sông Mã – tuyến đường trung tâm trong kế hoạch phát triển đô thị, hạ tầng kinh tế – xã hội của thành phố Thanh Hóa.', 'vihomes@gmail.com', 'https://fb.com/vinhomes', 'https://www.instagram.com//vinhomes', '09666666', 'Hà Nội - Việt Nam', NULL, 0, 0, '', NULL),
(2, 'Chợ đầu mối Long Biên', 1, NULL, NULL, 'cho.vn.t', 'Chợ Long Biên thuộc quận Ba Đình nằm phía bãi sông, sát cầu Long Biên.', 1, ' Ở đây có một khoảng đất rộng là nơi tập kết các loại thực phẩm như thịt cá, rau củ quả từ các vùng miền. Chợ nhộn nhịp suốt đêm, các xe từ mọi nơi đổ về chở theo các nông thuỷ sản rồi lại phân phối đi các chợ nhỏ trên khắp miền Bắc.', 'cholongbien@gmail.com', 'https://fb.com/cholongbien', 'https://www.instagram.com//cholongbien', NULL, 'Long Biên Hà Nội', NULL, 0, 0, '', NULL);
